import React from 'react';
import ReactDOM from 'react-dom';

const name = "sania";
const lname = "faizan";
const img1='https://picsum.photos/100/300';
const img2='https://picsum.photos/200/300';
const img3='https://picsum.photos/300/300';
ReactDOM.render(
<>
<h1 contentEditable='true'>{`Hello my name is ${name} ${lname}`}</h1>
<img src={img1}/>
<img src={img2}/>
<a href='www.google.com'><img src={img3}/><button>click me</button></a>

 </>,
   document.getElementById('root'));
